import React, { Component } from "react";
import { withAuth } from "utils/auth";
import { UserApi } from "services";

const bulletIcon = <span style={{ marginRight: "5px" }}>&#8226;</span>;
const highlightedBulletIcon = <span style={{ color: "green", marginRight: "5px" }}>&#8226;</span>;

class SecurePage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      userData: null,
      showPassword: false,
    };
  }

  componentDidMount() {
    this.loadUserData();
  }

  async loadUserData() {
    try {
      const { token, decodedToken } = this.props.auth;
      const api = new UserApi();
      api.setup();
      const response = await api.getUserById(token, decodedToken.id);

      if (response.kind === "ok") {
        this.setState({ userData: response.user });
      } else {
        console.error("Error fetching user data:", response.error);
      }
    } catch (err) {
      console.error("Error fetching user data:", err);
    }
  }

  togglePasswordVisibility = () => {
    this.setState((prevState) => ({
      showPassword: !prevState.showPassword,
    }));
  };

  render() {
    const { userData, showPassword } = this.state;

    return (
      <div style={{ maxWidth: "600px", margin: "auto" }}>
        <h1 style={{ textAlign: "center", marginBottom: "20px", color: "#333" }}>Secure Page</h1>
        {userData ? (
          <div style={{ border: "1px solid #ccc", borderRadius: "5px", padding: "20px", backgroundColor: "#f9f9f9", boxShadow: "0px 0px 10px rgba(0, 0, 0, 0.1)" }}>
            <div style={{ textAlign: "center", marginBottom: "20px", fontSize: "1.2rem" }}>
              <p><strong>Email:</strong> {userData.email}</p>
              {/* Conditionally render password with toggle button */}
              <p>
                <strong>Password:</strong>{" "}
                {showPassword ? (
                  <span>{userData.password}</span>
                ) : (
                  <span>*********</span>
                )}
                <button
                  onClick={this.togglePasswordVisibility}
                  style={{
                    marginLeft: "10px",
                    padding: "5px 10px",
                    backgroundColor: "#007bff",
                    color: "#fff",
                    border: "none",
                    borderRadius: "5px",
                    cursor: "pointer",
                  }}
                >
                  {showPassword ? "Hide" : "Show"}
                </button>
              </p>
            </div>
          </div>
        ) : (
          <div style={{ textAlign: "center", color: "#777" }}>Loading...</div>
        )}
      </div>
    );
  }
}

export default withAuth(SecurePage);
